/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `after_suscripcion_update` AFTER UPDATE ON `suscripciones` FOR EACH ROW BEGIN
    IF OLD.id_tipo_suscripcion != NEW.id_tipo_suscripcion THEN
        INSERT INTO historial_suscripciones (
            id_usuario, 
            id_tipo_suscripcion_anterior, 
            id_tipo_suscripcion_nuevo,
            motivo_cambio
        )
        VALUES (
            OLD.id_usuario,
            OLD.id_tipo_suscripcion,
            NEW.id_tipo_suscripcion,
            CASE 
                WHEN (SELECT precio_mensual FROM tipos_suscripcion WHERE id_tipo_suscripcion = NEW.id_tipo_suscripcion) > 
                     (SELECT precio_mensual FROM tipos_suscripcion WHERE id_tipo_suscripcion = OLD.id_tipo_suscripcion) THEN 'upgrade'
                ELSE 'downgrade'
            END
        );
    END IF;
END */;;
DELIMITER ;
